package com.example.demo.Beans;

public class Form {

	private String id;
	private String name;
	public Form() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Form(String id, String name) {
		super();
		this.id = id;
		this.name = name;
	}
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	
}
